import React from "react";
import './ItemForm.css' ;


const ChrinkedForm =(props)=>{
    const ToForm =(event)=>{
        event.preventDefault();
        props.change();
    }
    return (
        <form>{/* onSubmit={ToForm} Could be Div instead of Form .. OnSubmit could be OnClick*/}
            <button className="CenterButton" type="submit" onClick={ToForm}> Add Item </button>
            <input className="CenterButton"> Add Item </input>
        </form>
    );
}
export default ChrinkedForm;
